const ContactMe = () =>(

<div className="contact-content">
    <h1>Get In Touch</h1>
    <ul>
    <li><i class="fas fa-map-marker-alt"></i> Reserve Apartments, Austin, Texas -78754</li>
    <li><i class="fas fa-envelope"></i> Bakemore@gmail.com</li>
    <span><i class="fas fa-phone"></i> 000000</span>

    </ul>
</div>

);
export default ContactMe;
